var tipuesearch = {"pages": [{'title': 'About', 'text': '這裡是國立虎尾科技大學機械設計工程系大一的計算機程式課程網頁. \n CP2020 將在 \xa0 https://kaggle.com , \xa0 https://colab.research.google.com \xa0 以及可攜程式系統上進行. \n 以下是 CP2020 課程進行流程: \n W1 學員登入學校配發的 @gm 郵件帳號後, \xa0 填寫基本資料 \n W1 告知將利用 \xa0 Gitter \xa0 進行課程議題討論\xa0(其餘各種問題可以至 \xa0 discourse \xa0 討論) \n https://gitter.im/mdecourse/cp2020 \n https://forum.eng.nfu.edu.tw \xa0 \n W1 就電腦軟硬體與網路環境的使用進行介紹 \n W2 學員建立 \xa0 Github , \xa0 Gitlab, \xa0 Heroku \xa0 與 \xa0 Authorea \xa0 帳號 \n Github: 各學員在學號帳號下建立 cp2020 倉儲. \n Gitlab: 各學員將 cp2020 倉儲同步至 gitlab. \n Heroku: 雲端應用程式系統, 可部署靜態網頁與網際 Python 程式. \n Authorea: 各組用來編寫協同期末專案報告 pdf 檔案. \n W2 \xa0 學員利用 \xa0 Github Pages \xa0 與 \xa0 CMSiMDE \xa0 建立個人網頁 \n W2 學員學習如何利用 Git 與 Github 維護個人網頁 \n Ｗ3 統整 W1 與 W2 教材內容至各學員個人網頁 \n Ｗ3 完成亂數分組,\xa0 每班分成五組 \n W4 - W9 Python 基本語法與功能 \n Ｗ10 - W14 分組 Python 專案 \n Ｗ15 - W18 分組總結報告 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Topics', 'text': '', 'tags': '', 'url': 'Topics.html'}, {'title': 'w1', 'text': '', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '', 'tags': '', 'url': 'w3.html'}, {'title': 'w4 - w9', 'text': '', 'tags': '', 'url': 'w4 - w9.html'}, {'title': 'w10 - w14', 'text': '', 'tags': '', 'url': 'w10 - w14.html'}, {'title': 'w15 - w18', 'text': '', 'tags': '', 'url': 'w15 - w18.html'}]};